import './App.css';
import React, { useState, useEffect } from 'react';
import papaparse from 'papaparse'


function App() {
  const [meme,setMeme] = useState([])

  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    )
    .then(data => {
      for (var i =0; i<Object.keys(data.title).length; i++){
      setMeme(preState => [
        ...preState, {media:data.media[Number.toString(i)],
      score:data.score[Number.toString(i)],
    title:data.title[Number.toString(i)]}
      ])
    }
    console.log(data)
    console.log(Object.keys(data.title).length)
    })

  },[])

  return (
    <div className="App">
      <header className="App-header">
        <h3>{meme[0]}</h3>
      </header>
    </div>
  );
}

export default App;
